import React from 'react';
import axios from 'axios';
import {useState} from 'react';

function GetAllAccounts() {

    const [myArray, updateMyArray] = useState([]);

       axios.get('http://localhost:8080/accounts/')
           .then(res=> {
               return [
                   <div>{res.data}</div>
               ];
           })
}

export default GetAllAccounts;
